var Grid = require('walker/grid');

function Walker(){
    this.grid = false;
}

Walker.prototype = {
    init: function(i, j){
        this.grid = new Grid(i, j);
        this.grid.init();
        
        console.log(__filename, 'Grid.prototype: ', Grid.prototype);
        console.log(__filename, ': grid = ', this.grid.ID);
        
    }
}

module.exports = Walker;